import './AdminLogin.css';
import React, { Component } from 'react';
import { Redirect } from 'react-router-dom';


class AdminLogin extends Component {
    constructor(props){
        super(props);
        this.state ={
            username : '',
            password: '',
            loggedIn: false
        }
        this.onChange = this.onChange.bind(this)
        this.summitForm = this.summitForm.bind(this)
    }

    summitForm(e){
        e.preventDefault();
        const { username, password} = this.state

        //login magic
        if(username ===null || password===null){
            alert('username or password fail');
        }
        else if(username ==="abc" && password==="1"){
                localStorage.setItem('token','adavawdwd212421')
                this.setState ={
                loggedIn: true
            }
        }
    }

    onChange(e){
        this.setState({
            [e.target.name]: e.target.value
        })
    }
    render() {
        if(this.state.loggedIn){
            return <Redirect to="/admin-manager"/>
        }
        return (
            <div className="bg">
                <h3 style={{color:'white'}}>ADMIN LOGIN</h3>
                <form className="form" onSubmit={this.summitForm}>
                    <div className="form-group">
                        <input className="form-control" name="username" value={this.state.username} onChange={this.onChange} placeholder="Admin"/>
                    </div>
                    <div className="form-group">
                        <input type="password" className="form-control" name="password" value={this.state.password} onChange={this.onChange} placeholder="Password"/>
                    </div>
                    <input type="submit" style={{backgroundColor:'#4a77d4'}}/>
                </form>
            </div>
        );
    }
}

export default AdminLogin;
